module.exports = "<div class=\"parallax our-company-img\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 parallax-heading-container\">\n                <h1 class=\"lg-text\">Our Company</h1>\n                <p class=\"parallax-subHeading\">Health is by choice & not by chance</p>\n            </div>\n        </div>\n    </div>\n</div>\n<div class=\"paddingTB60\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-6\">\n                <img id=\"contentWrap-img\" src=\"../../assets/aboutus/our_company_1.png\" />\n            </div>\n            <div class=\"col-md-6 contentDiv\">\n                <h4 class=\"font19\">\n                    AFFORDABLE INTEGRATED STATE OF THE ART HEALTHCARE FROM MEDIAIDE SOLUTIONS\n                </h4>\n                <p class=\"font15\">\n                    Quality healthcare is expensive anywhere in the world. Very few countries have truly universal healthcare and some of those that do don’t offer free healthcare. The citizens still need to pay for their health insurance. For millions of people in developed\n                    countries like the United States, Canada and United Kingdom along with a few nations in Europe, advanced healthcare is almost unaffordable. Spending up to $200,000 for bone marrow transplant or around $3,000 for dental implants is\n                    beyond reckoning for a significant majority. This compels many to either avoid medical intervention or to look for alternatives.\n                </p>\n                <p class=\"font15\">\n                    There is no better alternative than fully integrated and affordable yet state of the art healthcare available in India. The thought of having to fly halfway across the world to a country one may not have been to can be quite unnerving. It is not just\n                    about the healthcare when it comes to medical tourism. One has to manage the visas, international flights, accommodation, doctor appointments and planning a remedial course at a chosen hospital. The choice of hospital alone can be\n                    a daunting challenge as there are plenty of options and one may have limited awareness of the quality of healthcare in India.\n                </p>\n            </div>\n        </div>\n    </div>\n</div>\n\n<div class=\"aboutus-hr-heading\">\n    <span>\n        MEDIAIDE SOLUTIONS-HOW WE HELP?\n    </span>\n</div>\n\n<div class=\"paddingTB60\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-6\">\n                <p class=\"font15\">\n                    MediAide Solutions is a company specializing in medical concierge. The company can plan the entire trip, get the visas for the purpose of seeking medical treatment, set up the appointments and coordinate with the hospitals, manage the medical records\n                    online, customize a package to include flights and hotel accommodation, work with the government authorities or agencies to facilitate easy transit through immigration and other formalities, ensure there is easy transportation available\n                    when you arrive and attend to your pretreatment as well as post treatment care. Everything from your daily needs to the actual purpose of your visit will be attended to by the experts at MediAide Solutions.\n                </p>\n                <p class=\"font15\">\n                    India is second to none when it comes to state of the art fully integrated healthcare. The fact that there are so many doctors of Indian origin in the United States, the United Kingdom and Singapore among other regions in the world is a testimony to their\n                    reliability and expertise. The only reason why medical treatments is more affordable in India compared to the US, the UK or Singapore is the currency. Bypass surgery costs $25,000 in the UK and $35,000 in the US. The same costs $6,000\n                    in India. From Lasik surgery to in-vitro fertilization, everything is exponentially more affordable.\n                </p>\n            </div>\n            <div class=\"col-md-6\">\n                <img id=\"contentWrap-img\" src=\"../../assets/aboutus/our_company_2.png\" />\n            </div>\n        </div>\n    </div>\n</div>\n\n<div class=\"paddingTB60\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-6\">\n                <iframe class=\"youtubeFrame\" src=\"https://www.youtube.com/embed/2aEHK4xabVQ\" frameborder=\"0\" gesture=\"media\" allow=\"encrypted-media\" allowfullscreen></iframe>\n            </div>\n            <div class=\"col-md-6\">\n                <p class=\"font15\">\n                    Our team strives to achieve excellence in every aspect of the medical process, from the preliminary medical assessments to your post treatment support. We carefully design our medical packages to be easy and flexible while making sure that most FAQ of\n                    our customers can be answered by our detailed documentation.\n                </p>\n                <h3 class=\"font19\">\n                    OUR VISION\n                </h3>\n                <p class=\"font15\">\n                    We focus on using the latest medical services standards and practices and strongly believe that a medical advocate on your part is necessary to convey the issues faced by the patient. We design your medical packages as per your medical needs and procedure\n                    requirements. Medical Visa, selecting the best course of action, Representation at the hospitals and consulting doctors, Pre & Post treatment care and attendant.\n                </p>\n                <p class=\"font15\">\n                    Once you select a standard package or a custom tailored package, we take care of everything to make your healing without any hassles.Our Expert physician specialists and caring clinical staff provide you with an exceptional health care experience at your\n                    hospital or hotel before and after your treatment.\n                </p>\n                <p class=\"font15\">\n                    Medical Records & History of our patron patients are stored in the state of the art cloud servers and can be fetched at any time without any charges.\n                </p>\n            </div>\n        </div>\n    </div>\n</div>\n\n<button class=\"btn btn-primary customBtn center-block\">BOOK AN APPOINTMENT NOW</button>\n\n<div class=\"aboutus-footer\">\n    <div>\n        <img src=\"../../assets/aboutus/health-care.png \" alt=\"Health Care \">\n    </div>\n    <div>\n        <h2>\n            GET STARTED AND BROWSE OUR BOUQUET OF MEDICAL PACKAGES\n        </h2>\n        <span>\n            Opt for a pre-designed package or ask for a custom package\n        </span>\n    </div>\n    <div class=\"mt20\">\n        <button style=\"background-color:#ffa516;\" class=\"btn btn-primary customBtn center-block\">MEDICAL PACKAGES</button>\n    </div>\n</div>\n<router-outlet></router-outlet>"

