module.exports = "<div class=\"container paddingTB60\">\n    <h2 class=\"fontColor\">TERMS AND CONDITIONS</h2>\n    <p class=\"font15\">\n        OUR TERMS AND CONDITIONS SPELL OUT YOUR ACCESS TO AND USE OF THIS WEBSITE AND THE INFORMATION, AND OTHER CONTENT AVAILABLE ON OR THROUGH THIS WEBSITE. PLEASE READ THESE TERMS AND CONDITIONS CAREFULLY, BEFORE USING THIS WEBSITE. WE RESERVE THE RIGHT, AT\n        OUR SOLE DISCRETION, TO CHANGE OUR TERMS AND CONDITIONS FROM TIME TO TIME. YOUR CONTINUED USE OF THIS WEBSITE AFTER SUCH CHANGES TAKE EFFECT WILL BE DEEMED TO CONSTITUTE YOUR ACCEPTANCE OF OUR NEW TERMS AND CONDITIONS. BY ACCESSING, USING, OR\n        BROWSING THIS WEBSITE OR ANY OF THE TABS, PAGES, OR WINDOWS ON THIS WEBSITE, YOU INDICATE THAT YOU HAVE READ, UNDERSTOOD, AND AGREE TO BE BOUND BY THIS AGREEMENT, AND THAT YOU UNDERSTAND AND INTEND THIS USER AGREEMENT TO BE THE LEGAL EQUIVALENT\n        OF A SIGNED, WRITTEN CONTRACT BETWEEN YOU AND MEDIAIDE SOLUTIONS, AND EQUALLY BINDING.\n    </p>\n    <br>\n    <h4 class=\"font19\">DESCRIPTION OF SERVICE</h4>\n    <p class=\"font15\">\n        MediAide Solutions is a medical tourism service agency, specialising in medical treatment and recuperation packages for destinations both, inside and outside of India. In this role, we research and gather publicly available information and provide this\n        information to you for your personal use, in making a more informed decision about your medical treatment options in India.\n    </p>\n    <h4 class=\"font19\">NOT A MEDICAL REFERRAL SERVICE</h4>\n    <p class=\"font15\">\n\n    </p>\n    <h4 class=\"font19\"></h4>\n    <p class=\"font15\">\n        MediAide.in is not a medical referral service and does not endorse, recommend, or approve any travel agency or healthcare provider listed on its website. We are not medical professionals and will not discuss or advise any issues relating to medical treatment.\n        We facilitate contact with, and provide information about doctors and their credentials in order for you to make informed decisions. We do not, however, recommend specific doctors for your desired medical treatment nor have any preferences regarding\n        the same. We encourage and advise you to discuss all medical issues with a medical doctor in your respective country, before making a decision on medical treatment in India. Through our medical tourism affiliates around the world and our in-depth\n        research, we provide information about available medical treatment and recuperation packages to assist you in making an informed decision.\n    </p>\n    <p class=\"font15\">\n        You agree to assume all responsibility in connection with choosing any doctor for your desired medical procedure. We assume no responsibility or liability for any treatment or other services rendered by any doctor, or for any malpractice claims and other\n        claims that may arise directly or indirectly from any such advice, treatment, or other services.\n    </p>\n    <h4 class=\"font19\"></h4>\n    <p class=\"font15\">\n\n    </p>\n    <h4 class=\"font19\">DISCLAIMERS</h4>\n    <p class=\"font15\">\n        his website is for informational purposes only. As we strive to provide the most accurate, up to date information possible, the website may contain technical inaccuracies or typographical errors, and may be changed or updated without notice. To the fullest\n        extent permissible pursuant to applicable law we assume no responsibility nor do we grant any warranties, express or implied, relating to the operation, safety, condition, or service of any physical, health care provider, hospital, aircraft, motor\n        vehicle, boat, other conveyance, inn, lodge, or hotel and/or products associated with such entities or services that are used wholly or in part by, for or on behalf of you. We are not liable for the acts, errors, omissions, representations, warranties,\n        breaches or negligence of any such suppliers or for any personal injuries, death, property damage, or other damages or expenses resulting there from.\n    </p>\n    <h4 class=\"font19\">LIMITATIONS OF LIABILITY</h4>\n    <p class=\"font15\">\n        You agree that neither we nor our international and national affiliates will be liable for any damages resulting from your use of, or reliance upon, this website, any website material, or any services obtained on or through this website. In the event\n        of any problem with this website, any website materials, or services obtained on or through this website, you agree that your sole remedy is to cease using such items. You agree that under no circumstances will MediAide Solutions or any of its\n        directors, officers, members, employees, agents, representatives, servants, attorneys, predecessors, successors or assigns, be liable for any indirect, incidental, special, punitive, exemplary or consequential damages (including, but not limited\n        to, lost profits and damages that result from inconvenience, delay, or loss of use) arising out of use of this website, any website materials, arrangements made based on information obtained on or through this website, or products or services\n        obtained on or through this website, even if we or they have been advised of the possibility of such damages.\n    </p>\n    <h4 class=\"font19\">INDEMNITY</h4>\n    <p class=\"font15\">\n        You agree to defend, indemnify, and hold harmless MediAide solutions and our affiliates, our and their respective directors, officers, members, employees, agents, representatives, attorneys, successors, and assigns, from and against any and all claims,\n        proceedings, damages, injuries, liabilities, losses, costs, and expenses (including reasonable attorneys’ fees and litigation expenses), relating to or arising from (i) your use of this website, any website materials, or services obtained on or\n        through this website, (ii) any arrangements you make based on information obtained on or through this website, or (iii) any breach by you of our terms and conditions.\n    </p>\n    <h4 class=\"font19\">VENUE</h4>\n    <p class=\"font15\">\n        You agree that these terms and conditions shall be governed by and construed in accordance with the Rajasthan Jurisdiction, INDIA. We agree that any legal action or proceeding under or with respect to these terms and conditions may be brought in the Court\n        of Rajasthan Jurisdiction, INDIA; and for the purpose of any such legal action or proceeding, you hereby submit to the jurisdiction of such courts. You hereby agree not to raise and waive any objection to or any defence based upon the venue of\n        such courts and any objection or defence based upon an inconvenient form. You also agree not to bring any legal action or proceeding under or with respect to these terms and conditions outside Rajasthan Jurisdiction, India.\n    </p>\n    <h4 class=\"font19\">COPYRIGHT AND OWNERSHIP</h4>\n    <p class=\"font15\">\n        Copyright © MEDIAIDE SOLUTIONS All Rights Reserved All of the website materials, including the content and display of this website are the property of MEDIAIDE SOLUTIONS. The website materials are protected by law, including, but not limited to, INDIA\n        and international copyright law and trademark law, as well as other state, federal, and international laws and regulations. Other names and logos on this website or which are a part of the website materials are trademarks and service marks of\n        our affiliates and may not be used without the permission of the trademark or service mark owner.\n    </p>\n    <h4 class=\"font19\">PRIVACY POLICY</h4>\n    <p class=\"font15\">\n\n    </p>\n    <h4 class=\"font19\"></h4>\n    <p class=\"font15\">\n        The information that we collect from our users is used only to facilitate the selection of desired destination and medical procedure. We do not sell or share your information to any third party at any time without your permission. The protection of our\n        users’ personal information is extremely important to us. Therefore, we have adopted a privacy policy outlining our personal information collection and use practices. Please refer to it for details about how we collect and use personal information\n        from users of this website. Any changes to the Privacy Policy will be posted on this website, and you should periodically consult this website to stay apprised of any such changes.\n    </p>\n    <h4 class=\"font19\">LINKS TO OTHER WEBSITES</h4>\n    <p class=\"font15\">\n        This website contains links to other websites on the World Wide Web for the convenience of our users. These other sites are maintained by third parties over whom we exercise no control. Accordingly, we expressly disclaim any responsibility for the content\n        of these other websites and for the availability, accuracy, reliability, completeness, currency, quality, performance, or suitability of the information, products, and services available or advertised on or through these other sites.\n    </p>\n    <h4 class=\"font19\">PAYMENT TERMS</h4>\n    <p class=\"font15\">\n        All participants will be required to make payment through certified or personal check in order to confirm all bookings. Four weeks prior to departure, a 20% deposit of the total procedure price will be required to reserve booking. All payments need to\n        be made directly in the name of MEDIAIDE SOLUTIONS via bank transfers, demands drafts, or cheques. No other person or authority is allowed to take payments in any form. MediAide Solutions will not be responsible for the same.\n    </p>\n    <h4 class=\"font19\">CANCELLATION AND CHANGES</h4>\n    <p class=\"font15\">\n        Because of the special nature of medical and tour packages featured on this website, our affiliates may impose variable cancellation fees. You agree that MEDIAIDE SOLUTIONS has no control over such fees and cannot consider making any exceptions to these\n        charges. Airfares are subject to different rules and cancellation fees; some may be non-refundable. To protect against cancellation charges, we strongly recommend purchasing Cancellation Protection and Travel Interruption Insurance. Due to the\n        complexity involved in this field, there is a rare possibility that the doctor might not treat a patient upon examination after arrival in India.\n    </p>\n    <h4 class=\"font19\">TRAVEL DOCUMENTS</h4>\n    <p class=\"font15\">\n        All participants must be in possession of a valid passport during time of travel. Depending on length of visit, a Visa or may be required for some or all of the countries visited. Please check your visa requirement at time of booking. MEDIAIDE SOLUTIONS\n        will provide visa information if needed.\n    </p>\n    <h4 class=\"font19\">PRICES, RATES, AND FARES</h4>\n    <p class=\"font15\">\n        Unless otherwise indicated, all prices shown are in Indian Rupees and are per person. These prices are in effect from 2017 and are subject to change at any time prior to departure.\n    </p>\n</div>"

