module.exports = "<div class=\"parallax our-company-img\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 parallax-heading-container\">\n                <h1 class=\"lg-text\">WHY US</h1>\n            </div>\n        </div>\n    </div>\n</div>\n<div class=\"container paddingTB60\">\n    <div>\n        <h4 class=\"font19\">\n            WHY US\n        </h4>\n        <p class=\"font15\">\n            For medical services, it is important to choose the best who offers a high- quality standards. Madiaide.in ensures that your healthcare will be on the right hand. We are doing the best quality of service for you to have an easier process and procedures\n            to achieve a healthy well- being. We are also giving extra packages that serves as a gratitude for trusting us. Other than caring for your health, we also assure that your visit will be a worth it experience.\n        </p>\n    </div>\n\n    <div>\n        <h4 class=\"font19\">\n            Our Mission\n        </h4>\n        <p class=\"font15\">\n            The main goal of our service is to provide you a hassle- free healthcare. Partnering with the most trusted doctors and hospitals, you can select the best one for your health. We also wanted to have an easier access to all the processes and procedures.\n        </p>\n    </div>\n    <div class=\"row\">\n        <div class=\"col-md-6\">\n            <div>\n                <h4 class=\"font19\">\n                    OUR SERVICE\n                </h4>\n                <p class=\"font15\">\n                    Madiaide.in is responsible for your health, safety and comfort from the day you arrive up to your departure from the hospital. Our team will assist you before and after you visit India. We also created a comprehensive guide to manage the health of our\n                    clients. Apart from it, we also provide medical records through online that they can easily access. Convenience is one of our top priority. With a hassle-free medical healthcare, you can also experience a high- quality facilities that\n                    is best for your treatment and other procedures. We are composed of professional team members that can accommodate your visit in India.\n                </p>\n            </div>\n        </div>\n        <div class=\"container\">\n            <div class=\"col-md-5 about-right\">\n                <div class=\"col-md-1 service-num\">\n                    <h5>01</h5>\n                </div>\n                <div class=\"col-md-11\">\n                    <p class=\"font15\">\n                        We offer state of the art medical care without inflating the costs. India has the necessary healthcare facilities for every treatment you need. The foreign exchange rates are an advantage for anyone traveling from the United States, the United Kingdom,\n                        Europe, Australia, Canada, New Zealand, the Middle East, China or Japan. We help you to truly realise that benefit.\n                    </p>\n                </div>\n                <div class=\"col-md-1 service-num\">\n                    <h5>02</h5>\n                </div>\n                <div class=\"col-md-11\">\n                    <p class=\"font15\">\n                        Accommodation, traveling such as flights, trains and chauffeur driven cars, food and beverage, personalised care and touring different parts of the country while you are here would be more affordable than in your country. However, while another medical\n                        tourism service provider will inflate the costs and present premium plans to cater to your needs, we offer state of the art and completely satiating solutions at an affordable price.\n                    </p>\n                </div>\n                <div class=\"col-md-1 service-num\">\n                    <h5>03</h5>\n                </div>\n                <div class=\"col-md-11\">\n                    <p class=\"font15\">\n                        ​As your trusted medical aide, specialised advisor and personal concierge, we would take care of everything. We can help you plan the entire trip, be it arranging the legal documents necessary to travel to and to stay in India or attending to your various\n                        needs throughout your stay. With our expertise, commitment and resources, you wouldn’t have to worry for one moment before you arrive or during your stay.\n                    </p>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>"

